import { Link } from 'react-router-dom';
import styled from 'styled-components';

const Header = styled.div`
  display: flex;
  padding: 16px;
  -webkit-box-pack: justify;
  justify-content: space-between;
  -webkit-box-align: center;
  align-items: center;
  width: 100%;
  background: rgb(51, 51, 51);
  color: white;
`;

const Gihtubviewer = styled.h1`
  white-space: nowrap;
  color: white;
`;

const Ulist = styled.ul`
  display: flex;
  width: 100%;
  padding: 0px 32px;
`;

const List = styled.li`
  list-style-type: none;
  margin-right: 16px;
`;

const Toggle = styled.div`
  padding: 8px;
  font-size: 1.2rem;
`;

const Icon = styled.i`
  cursor: pointer;
`;

function App() {
  return (
    <div className="App">
      <Header>
        <Link to="/">
          <Gihtubviewer>Github Viewer</Gihtubviewer>
        </Link>
        <Ulist>
          <List>Issue</List>
          <List>Pull Request</List>
        </Ulist>
        <Toggle>
          <Icon className="fa fa-bars"></Icon>
        </Toggle>
      </Header>
      ss
    </div>
  );
}

export default App;
